import React, { useState } from "react";
import ReactDOM from "react-dom";
import { BrowserRouter as Router, Route } from 'react-router-dom'

import './style.css';
import './style2.css';

import LoginP from './main/login';
import Main from './main/main';
  
const App = () => {
  return (
    <Router>
      <div>
        <Route
          component={Main}
          exact
          path="/main/main"
        />
      </div>
    </Router>
  )
}

export default App
